// src/pages/Welcome.jsx
import { useNavigate } from 'react-router-dom';
import './Welcome.css';
import logo from '../assets/logo.png'; // Replace with your actual logo file path

export default function Welcome() {
  const navigate = useNavigate();

  return (
    <div className="welcome-wrapper">
      <header className="welcome-header">
        <img src={logo} alt="DocuPort Logo" className="logo" />
        <h1 className="title">Welcome to DocuPort</h1>
        <p className="subtitle">An Online Portfolio Storage Portal</p>
        <button className="login-btn" onClick={() => navigate('/login')}>Go to Login</button>
      </header>
    </div>
  );
}
